import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
    return (
        <div className="App">
            <ul>
                <li>
                    css
                </li>
                <li>js</li>
                <li>html</li>
                <li>react</li>
                <Header/>
            </ul>
        </div>
    );
};

const Header = () => {
    return (
        <div className="App">
            <a href={'#'}>js</a>
            <a href={'#'}>html</a>
            <a href={'#'}>react</a>
        </div>
    );
};

export default App;
